window.bookSummaryJSON = "<p>When Kadence has a vision of a cabin in the woods, Saxon and his friends are determined to find it.</p> <p>He’s beginning to think they’re on a wild goose chase...until he stumbles across the cabin and a horde of savages.</p> <p>Elyse and her father have spent months imprisoned by savages. Tortured and brutalized, she has no hope of getting out alive. When Saxon arrives, he gives her a chance at freedom; however, he wants to know why the savages imprisoned her, and she can never reveal that.</p> <p>She tries to keep her distance, but when they are trapped together, it becomes increasingly difficult to resist the growing desire between them.</p> <p>Desperate to save her father, Elyse realizes Saxon may be the only one who can help her, but if she reveals the truth, will he forgive her...or kill her?</p> <p>The Alliance Series is a spin-off of the Vampire Awakenings series. You do not have to listen to the Vampire Awakenings Series to follow the Alliance Series.</p> <p>Due to violence, language, and sexual content this book is recommended for listeners 18 and up.</p>"; 
